import dayjs from "dayjs"

export const yyyymmddhhmmss = (date: string) => {
 return dayjs(date).format("MM-DD HH:mm:ss")
}
export const yyyymmddhhmmss2 = (date: string) => {
 if (date) {
  return  dayjs(date).format("MM/DD HH:mm")
 }
}
